import React, { useEffect } from 'react';
import { useLogged } from '../App';


export function Home(props) {

    var { data } = useLogged()
    useEffect(() => {
        console.log(data?.logged)
    })

    return (
        <div>
            <div>
                <p> user: {props.user}</p>
                <p> password: {props.password}</p>
            </div>
        </div>
    )
}
